"""Supongamos que $n \in \mathbb{N}$, ¿cómo hago para simular un dado con $n$ caras?"""

def dado(n):
  import random
  import numpy as np
  u = random.random()
  I = None
  particion = np.linspace(0,1,n+1)  # start, stop, number of points
  for i in range(n-1) :
    if particion [i] < u < particion[i+1]:
      I = i + 1
      break
  if I == None:
    I = n
  return I

muestra = [dado(6) for _ in range(10000)]
ind = [1 if d == 3 else 0 for d in muestra]
sum(ind)/10000

"""Programaremos la función que dado un vector de $n$ entradas, devuelve $k$ ($k \leq n$) de ellas."""

def bernoulli(vector, k):
  import random
  I = []  # un contador
  seleccionados = []
  n = len(vector)
  uniformes = [random.random() for _ in range(n)]
  for i in range(n):
    if uniformes[i] < (k - sum(I)) / (n - i):
      I.append(1)
      seleccionados.append(vector[i])
    else:
      I.append(0)
  return seleccionados

