"""Ejercicio: Programar una función que reciba un número natural $n$ y devuelva una aproximación numérica a la integral

$$ \int_{0}^{1}x^{n}dx$$
"""

def integral_polinómica(N, n, a = 0, b = 1):
  # Importamos las librerías que usaremos
  import random
  import numpy as np

  # Generamos nuestras N variables uniformes
  U1 = np.array([random.random() for _ in range(N)])  # y
  U2 = np.array([random.random() for _ in range(N)])  # x

  # Definimos nuestra variable de conteo
  indicadora = 0

  # Escalamos nuestras variables (ahora son uniformes en un intervalo "(a, b)")
  U1ab = (b-a)*U1 + a
  U2ab = (b-a)*U2 + a

  # Calculamos la probabilidad de caer por debajo de la gráfica de la función
  for i in range(N):
    if U1ab[i] < U2ab[i]**n:
      indicadora += 1

  return(indicadora/N)

