# Importamos las librerías a utilizar
import random
import numpy as np

# Definimos el número de iteraciones y una semilla para reproducibilidad
N= 1000000
random.seed(123)

# Generamos nuestras muestras uniformes
Y = np.array([8*random.random() for _ in range(N)])  # multiplica esta variable aleatoria por "8" porque es la cota superior de la función que se integra (bueno, ojo, es una aproximación a la cota. la verdadera cota es un poco más pequeña; sólo un poquito)
X = np.array([0.55*random.random() for _ in range(N)])  # y multiplica por "0.55" porque se integra de "0" a "0.55"
# lo anterior es para que las variables aleatorias queden en los rangos correspondientes.

indicadora = 0  # introduce a counter

# Definimos k
import math
k = math.factorial(99)/(math.factorial(49)**2)  # así calculó la función "beta(50, 50)"

# Definimos a la función f
def f(x):
  return(k * (x**49) * ((1-x)**49))

# Verificamos que ocurra el evento en el cual estamos interesados
for i in range(N):
  if Y[i] <= f(X[i]):  # 0 <= Y <= 8, 0 <= X <= 0.55
    indicadora += 1

# Aplicamos la fórmula vista en clase ("P(Y <= f(X)) * M * (b - a)") e imprimimos
print('La integral es:', 4.4*indicadora/N)  # "4.4" es el área del rectángulo que contiene a la gráfica que estamos considerando ("M * (b - a)"). y la fracción es la probabilidad de caer por debajo de la función

